import React from "react";

 const Cardtemplate = ({comma, description, imgurl, name, textcolor, bgcolor}) => {
   console.log(`./../images/testimonial_images/${comma}`)
    return(
        <div style={{backgroundColor:bgcolor, color:textcolor}} className="card">
            <center><img src={require(`./../images/testimonial_images/${comma}`)} alt="comma" className="comma" /></center>
            <p className="description">{description}</p>
            <div className="pic-name">
                <div><img src={require(`./../images/testimonial_images/${imgurl}`)} alt="img" className="image"></img></div>
                <div className="name">{name}</div>
            </div>
        </div>
    )
}
export default Cardtemplate
